            "created": 1417881835000, 
            "description": "<p>Please join us for an exciting talk by Dr. Alexandr \"Sasha\" Draganov about the mathematics behind prediction and mitigation of rare, catastrophic events.\u00a0</p> <p><b>About the Talk</b></p> <p>How do we quantify risk that is associated with a financial instrument?\u00a0Intuitively, risk is clearly connected to the\u00a0probability of a loss.\u00a0 In a simple case, we estimate the volatility; however, the dreadful experience of the recent financial crisis shows that volatility alone does not paint the full picture.\u00a0 The common computation of volatility misses the possibility of rare but catastrophic events. \u00a0</p> <p><br/>One possible reason for this limitation is the overuse of the so-called normal probability distribution.\u00a0 It is called \"normal\" for a reason: indeed, it is the most common way to characterize random variations (such as variations in the value of securities).\u00a0 However, this tool must not be applied indiscriminately.\u00a0 A deeper dive shows that it often fails for large, rare variations, precisely when\u00a0there is a possibility of a failure. \u00a0</p> <p>This concept was popularized by Nassim Nicholas Taleb, who christened such events Black Swans.\u00a0 Popular books notwithstanding, there is a real mathematical foundation today to deal with this problem.\u00a0 Applications are common in the insurance industry (Hurricane Katrina) or for construction in the regions, where earthquakes are common.\u00a0</p> <p>We have recently completed a DARPA-funded research program, where we applied these new ideas for engineering applications.\u00a0 Using real data from various sensors, we were able to detect and mitigate outliers in real time.\u00a0 In this presentation, we will review the concept and the science of rare, catastrophic events, and will talk about ways to alleviate their effects.</p> <p><b>Meetup Agenda</b></p> <p><br/>6:30 PM - Networking, Food &amp; Drink</p> <p>7:00 PM - Intro &amp; Talk</p> <p>Join us for more discussion after the event with Data Drinks (location TBD).</p> <p><b>Sponsors for this Event</b></p> <p>Thanks to <a href=\"http://www.datacommunitydc.org/\">Data Community DC</a> for organizational support, to <a href=\"https://www.contactually.com/\">Contactually</a>\u00a0for space, and to <a href=\"https://www.excella.com/careers\">Excella Consulting</a> for our food and drink.</p> <p><b>About Our Speaker</b></p> <p>Alexandr \u201cSasha\u201d Draganov grew up in the Soviet Union, with a limited access to computers. When you cannot rely on a computer, you have to compensate by honing your math and analytical techniques. Today, Sasha uses these skills to do research and development in multiple fields, including applied mathematics, algorithm development, signal processing, and telecommunications. He authored winning proposals and served as the Principal Investigator for multimillion-dollar research and development programs. Sasha published over 40 papers, and presented at dozens of conferences. He holds five U.S. patents. He has a Ph.D. in Electrical Engineering from Stanford and a Masters in Theoretical Physics from Kiev University, Ukraine.</p> <p>Sasha runs two start-up companies: one is performing contract research and development for government and commercial customers, and another is developing an innovative software application for personal finance.</p> <p>Sasha loves books. He got hooked on reading while serving 2 years in the Soviet military in a small town, where a local library was the only source of entertainment. He remembers a jolt from reading first few pages of Swann\u2019s Way by Marcel Proust on the steps to a radar cabin. Proust remains one of favorite authors, as are Leo Tolstoy and Robert Musil.\u00a0 Recently, Sasha published a scholarly article in a refereed journal on the idea of virtue in Tolstoy\u2019s work.\u00a0 Sasha also loves fine art and has visited many major art museums all over the world.</p>", 
