            "created": 1456601656000, 
            "description": "<p>Say you're building a simple website with five pages linked together, and a simple navigation bar at the top. You make some changes to the code and want to know if everything still works. So you open your local version of the webpage and click through each button on the navigation bar to make sure they each still lead to the right destination. Not hard, and it doesn't take long.</p> <p>But now imagine you make some changes to a more complex app--one with 20 pages, a login system, various forms, and content that should look different depending on which type of user you're logged in as. You could come up with a checklist of all the buttons you'd have to manually click on\u2014and forms you\u2019d have to test-submit in various ways\u2014while logged in as various different users, checking to make sure your changes didn\u2019t accidentally blow up an obscure but necessary function of your website. Repeating a long list of tests every time you make a small update to your app would get repetitive and tedious.\u00a0</p> <p>Thankfully, computers love doing repetitive and tedious tasks for us! Automated testing\u2014when we write code to perform tests on other code\u2014helps us as developers to save time, expose poorly written code, confidently expand or update our apps, sleep better at night knowing that bugs are permanently addressed, and even think more critically when we sit down to write an app from scratch.\u00a0</p> <p>In this meetup we'll examine one of the most popular testing frameworks for Rails applications, called RSpec.\u00a0</p> <p>***</p> <p>\n\n\nMeetup Agenda</p> <p>\u2022\u00a06:30pm - Setup and start working</p> <p>\u2022 7pm - Break for quick introductions</p> <p>\u2022 7:15pm - \"Ruby on Rails: Intro to RSpec\"</p> <p>\u2022 8:15 - 8:30pm - Wrap Up</p> <p>\n\n\n***</p> <p>Interested in learning Ruby and Rails with an awesome group of women? Looking to build your first web app, learn more about coding, or build on existing skills? Come to our weekly ROR group! We welcome women with all levels of experience. You will be able to ask your fellow coders questions and help each other work through issues. We encourage any advanced ROR devs to come and help others! There's always at least one mentor present to help you with best practices or guide you through if you are stuck with a nasty problem!</p> <p>Contact policy at buildings that need access</p> <p>Certain building managements requires meetup hosts to let people in and do not encourage them being contacted. Please respect the policy, in case the location requires access to the building contact the group lead if information is provided, or drop a comment on the meetup page. We'll come and get you. Want to be a Ruby on Rails Study Group leader? If you are passionate about learning ROR with fellow awesome women and want to help us, come on out! Drop us a message or email us and let us know that you are interested in helping us with the Rails study group!</p> <p>RESOURCES</p> <p>These are the resources that members have been using. Feel free to suggest others if you have more to add!</p> <p><a href=\"https://github.com/womenwhocodedc/organization/blob/master/learning-resources/ruby-on-rails/rails_guide.md\"><a href=\"https://github.com/womenwhocodedc/organization/blob/master/learning-resources/ruby-on-rails/rails_guide.md\" class=\"linkified\">https://github.com/womenwhocodedc/organization/blob/master/learning-resources/ruby-on-rails/rails_guide.md</a></a></p> <p>This event is intended to be exclusively open for people who identify as women - we are transgender friendly.</p> <p>Request to join our Slack channel for communication:</p> <p><a href=\"http://bit.ly/wwcdcslack\"><a href=\"http://bit.ly/wwcdcslack\" class=\"linkified\">http://bit.ly/wwcdcslack</a></a></p>", 
